import React from 'react';
import styled from 'styled-components';
import Constants from '../constants'
import {Alert, Image, StyleSheet, TextInput} from 'react-native'

const SearchItemTextInput = ()=>{
  return(
  <TextInput
    editable
    maxLength={10}
    placeholder = "Search"
  />
  );
}
class Home extends React.Component{
  render(){
    return(
      <Background>
        <StatusBar/>
        <Menu>
          <Image style = {{backgroundColor:'white', width:25, height:25,left:8}} source={require('../images/settings.svg')}/>
          {/* To do, style text */}
          <Text style={{}}>AppName</Text>
          <Image style = {{backgroundColor:'white', width:25, height:25,right:8}} source={require('../images/menu.svg')}/>
        </Menu>
        <ItemContentContainer>
          <SearchItemContainer>
            <SearchItemTextInput style = {{ height: 40, fontSize: 18 }}></SearchItemTextInput>
          </SearchItemContainer>
          <CategoriesContainer>
            <Text style = {{marginTop:5}}>Categories</Text>
          </CategoriesContainer>
          <ItemContainer>
            {testItems.map((item,index)=>(
              <Item
              key={index}
              >
                <Text style={{backgroundColor:'white'}}>{item.name}</Text>
                <Text>{item.quantity}</Text>
              </Item>
            ))}
            
          </ItemContainer>
        </ItemContentContainer>
      </Background>
      );
    }
}

export default Home;

const testItems = [
  {
    name: 'Fresh',
    quantity: 7
  },
  {
    name: 'Prime',
    quantity:8
  }
];

const Background = styled.View`
  top:0;
  left:0;
  width: 100%;
  height: 100%;
  background-color: ${Constants.COLOR1};
`;
const StatusBar = styled.View`
  position:relative;
  top:0;
  left:0;
  background:${Constants.COLOR2};
  width:100%;
  height: ${Constants.statusBarHeight};
  /* opacity: ${Constants.OPACITY}; */
`;
const Menu = styled.View`
  /* position: static; */
  width: 100%;
  height: 52px;
  left: 0px;
  top: 0px;
  flex-direction:row;
  justify-content:space-between;
  align-items:center;
  background: ${Constants.COLOR2};
  opacity: ${Constants.OPACITY};
`;
const Text = styled.Text``;
const ItemContentContainer = styled.View`
  margin-left:5%;
`;
const SearchItemContainer = styled.View`
  /* position: static; */
  border-width:1px;
  width:95%;
  border-radius:4px;
  margin-top:12px;
  /* margin-left:5%; */
`;
const CategoriesContainer = styled.View`
`;
const ItemContainer = styled.View`
  height:83%;
  width:95%;
  background-color:black;
  /* margin-left:5%; */
`;
const Item = styled.View`
  height:20px;
  width:100%;
  background-color:white;
  margin-top:5px;
  flex-direction:row;
  justify-content:space-between;
`;
